ge({display: im});\n    }\n    var fits = 'cutouts/' + id.toString() + '_' + filter + '.fits.gz'; \n    JS9.Load(fits, {zoom:'toFit', scale:'sqrt', scaleclipping:'zscale'}, {display:filter});\n}\n\nvar inds = ha_source.selected['1d'].indices[0];\nvar data = ha_source.data;\n\nvar allfilters = ['DIFF_E1','F658N_E1','F625W_E1','DIFF_E2','F658N_E2','F625W_E2',\n                  'F275W','F336W','F475W','F814W','F110W','F160W'];\nvar stats = ['Best','Exp','p16','p50','p84'];\n\nif (typeof(cb_obj.selected) != 'undefined') {\n    var id = data['id'][inds];\n    for ( i = 0; i < allfilters.length; i++) {\n        loadNewImage(allfilters[i],id);\n    }\n    var filt = filters.data;\n    var filt_f = filters_flux.data;\n    var mags = [16,28];\n    for (i = 0; i < filt['wav'].length; i++) {\n        var key = filt['key'][i];\n        var mag = data[key.toLowerCase() + '_vega'][inds];\n        var rate = data[key.toLowerCase() + '_rate'][inds];\n        if ((mag < 35) && (mag > 10)) {\n            mags.push(mag);\n        } else {\n            mag = 'nan';\n        }\n        if ((mag < 35) && (mag > 10)) {\n            mags.push(mag);\n        } else {\n            mag = 'nan';\n        }\n        filt['mag'][i] = mag;\n        filt['rates'][i] = rate;\n        if ((key != 'F625W') && (key != 'F658N')) {\n            var k = i;\n            if (i > 2) { k = i - 2; }\n            for (j = 0; j < stats.length; j++) {\n                var detector;\n                if ((key == 'F475W') || (key == 'F814W')) {\n                    detector = 'ACS_WFC';\n                } else {\n                    detector = 'WFC3';\n                }\n                var flux_nd = data['logHST_' + detector + '_' + key + '_nd_' + stats[j]][inds];\n                var flux_wd = data['logHST_' + detector + '_' + key + '_wd_' + stats[j]][inds];\n                filt_f['flux_nd_'+stats[j]][k] = flux_nd;\n                filt_f['flux_wd_'+stats[j]][k] = flux_wd;\n            }\n        }\n    }\n    filters.trigger('change');\n    filters_flux.trigger('change');\n    var maxmag = Math.max(...mags);\n    var minmag = Math.min(...mags);\n    var yrange = maxmag - minmag;\n    if (minmag < 16) {\n        y_range.end = minmag-0.1*yrange;\n    } else {\n        y_range.end = 16;\n    }\n    if (maxmag > 28) {\n        y_range.start = maxmag+0.15*yrange;\n    } else {\n        y_range.start = 28;\n    }\n} else {\n    JS9.SetZoom('toFit');\n}\n\nreturn false;\n"},"id":"d3ef297c-aa8c-4a6c-acd2-92f01961b576","type":"CustomJS"},{"attributes":{"plot":{"id":"43411499-ad7b-44af-8d6a-76ca5a8c51d4","subtype":"Figure","type":"Plot"},"ticker":{"id":"fdf977ad-a6c0-470e-a19f-b26684336e5a","type":"BasicTicker"}},"id":"43feaf9d-ee59-40c4-893a-58fc54e557f5","type":"Grid"},{"attributes":{"plot":{"id":"f8efe816-9f15-46ac-9261-4acdf3a3290c","subtype":"Figure","type":"Plot"}},"id":"0e826bfa-a989-4a63-ac7a-b2e3c0145832","type":"WheelZoomTool"},{"attributes":{"plot":{"id":"f8efe816-9f15-46ac-9261-4acdf3a3290c","subtype":"Figure","type":"Plot"}},"id":"bb80e439-10b1-40af-a9b4-0c7282ae2f81","type":"ResetTool"},{"attributes":{"data_source":{"id":"aad45848-27a3-46c5-ac85-9f9a8d7ca8f4","type":"ColumnDataSource"},"glyph":{"id":"7a5df027-4ccd-478d-a9ef-86d9834b8059","type":"Circle"},"hover_glyph":null,"name":"ha_bright","nonselection_glyph":{"id":"1ef69b70-1e04-4651-ad1b-e78722b0b877","type":"Circle"},"selection_glyph":{"id":"f253c482-85ef-4443-9076-d245be29507f","type":"Circle"}},"id":"efda36f9-58b7-4b7b-9503-893aee8c8db4","type":"GlyphRenderer"},{"attributes":{"callback":null,"column_names":["y","x"],"data":{"x":{"__ndarray__":"lM3qa6PWyT+a4J7SOGHRPznXXpenftU/pY6v4f1/3j+zexCkmAbkPz0WxBJlEuU/xwNLbYfV6T8PfumNGZnyP9XFzWlSoPg/2tMYixP//T8=","dtype":"float64","shape":[10]},"y":{"__ndarray__":"rk/Sia2gMUA66rT+YgkyQMEs/wRskzJA3HKSn4tBNEB5pB41TY80QOQc3t6weDRAgd9iL6++NEAQdL5UsRE1QLAh9j3dSjVAbhn609hgNUA=","dtype":"float64","shape":[10]}}},"id":"04ceaa7a-9308-418c-b64f-35eabb377599","type":"ColumnDataSour
